import React, { useState, useEffect } from "react";
import CurrentWeatherStyles from "./CurrentWeatherStyles";
import AccordionComp from "./AccordionComp";
import dateBuilderAccordion from "./dateBuilderAccordion";

export default function WeeklyWeather({ weather, weatherDetails }) {
  console.log(weatherDetails);

  return (
    <CurrentWeatherStyles style={{backgroundColor: "#000"}}>
      <div
        className={
          typeof weather.main != "undefined"
            ? weather.main.temp > 16
              ? "weather_container warm"
              : "weather_container"
            : "weather_container"
        }>


        <AccordionComp
          today={dateBuilderAccordion(new Date())}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[0].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[0].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[0].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[0].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[0].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[0].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[0].temp.night - 271)}
        />
        <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[1].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[1].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[1].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[1].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[1].temp.day - 271)}
