          max_temp={Math.round(weatherDetails.daily[2].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[2].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[2].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[2].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[2].temp.night - 271)}
        />
        <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[3].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[3].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[3].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[3].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[3].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[3].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[3].temp.night - 271)}
        />
        <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[4].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[4].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[4].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[4].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[4].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[4].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[4].temp.night - 271)}
        />
         <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[5].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[5].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[5].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[5].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[5].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[5].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[5].temp.night - 271)}
        />
         <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[6].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[6].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[6].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[6].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[6].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[6].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[6].temp.night - 271)}
        />
         <AccordionComp
          today={dateBuilderAccordion(new Date(weatherDetails.daily[7].dt * 1000))}
          src={`https://openweathermap.org/img/wn/${weatherDetails.daily[1].weather[0].icon}.png`}
          min_temp={Math.round(weatherDetails.daily[7].temp.min - 271)}
          max_temp={Math.round(weatherDetails.daily[7].temp.max - 271)}
          morning_temp={Math.round(weatherDetails.daily[7].temp.morn - 271)}
          afternoon_temp={Math.round(weatherDetails.daily[7].temp.day - 271)}
          evening_temp={Math.round(weatherDetails.daily[7].temp.eve - 271)}
          night_temp={Math.round(weatherDetails.daily[7].temp.night - 271)}
        />




      </div>

    </CurrentWeatherStyles>
  );
}
